import React from 'react';
import useAuth from '../../../hook/useAuth';

const Login = () => {
    const { signInUsingGoogle } = useAuth();
    return (
        <div className="mt-5">
            <button onClick={signInUsingGoogle} className="btn btn-info mb-5">Google Sign In</button>
        </div>
    );
};

export default Login;
